import React, { useRef, useState } from "react";

function Fuck(props) {
  const{productList} = props;
  console.log(productList);
  return (
    <>
     {productList.map((val) => {
              return (
                <React.Fragment>
                  <div className="productsItem">
                    <div className="productsItemPic">
                      <Link to={`/marian/productinside/${val.productId}`}>
                        <img
                          src={`https://picsum.photos/200/280/?random=${val.productId}`}
                        />
                      </Link>
                      <i
                        onClick={shit}
                        id="productsItemCart"
                        className="fa fa-cart-plus fa-2x"
                        aria-hidden="true"
                      ></i>
                    </div>
                    <h3>
                      <Link to={`/marian/productinside/${val.productId}`}>
                        {val.productName}
                      </Link>
                    </h3>
                    <p>NT{val.productPrice}</p>
                    <div className="productsItemCart">
                      <i
                        id="productsItemCart"
                        className="fa fa-cart-plus fa-2x"
                        aria-hidden="true"
                      ></i>
                    </div>
                  </div>

                </React.Fragment>
              );
            })}
    </>
  );
}

export default Fuck;
